[DESCRIPTION.]:
The Vuelta a Espaa (English: Tour of Spain) is a three-week
road bicycle racing stage race that is one of the three &quot;Grand
Tours&quot; of Europe and part of the UCI World Ranking calendar.
The race lasts three weeks and attracts cyclists from around
the world. The race is broken into day-long segments, called
stages. Individual times to finish each stage are totalled to
determine the overall winner at the end of the race. The rider
with the lowest aggregate time at the end of each day wears
the Red Jersey.


Stage05: Sierra Nevada - Valdepeas de Jan
Distance: 187 km (Medium Mountain Stage)

